    "# **BEYOND MILK & COOKIES**\n",
    "### How the Apriori algorithm reveals surprising product pairings"
   ]
  },
  {
   "cell_type": "markdown",
   "id": "6f3b3bdc",
   "metadata": {
    "papermill": {
     "duration": 0.014952,
