    "library(dplyr)\n",
    "\n",
    "# Ensure the 'Date' column is in a consistent format, if not already\n",
    "groceries$Date <- as.Date(groceries$Date, format = \"%d-%m-%Y\")\n",
    "# If some dates are in a different format, you might need additional handling\n",
    "\n",
    "# Get a summary of duplicates\n",
    "duplicate_summary <- groceries %>%\n",
    "  group_by(Member_number, Date, itemDescription) %>%\n",
    "  summarise(count = n(), .groups = \"drop\") %>%  # Adding .groups = \"drop\" to remove grouping\n",
    "  filter(count > 1) %>%\n",
    "  arrange(desc(count))\n",
    "\n",
    "# Check the output\n",
    "print(duplicate_summary)\n",
    "\n",
    "# Check the distribution of duplicates across items\n",
    "item_dup_distribution <- duplicate_summary %>%\n",
    "  group_by(itemDescription) %>%\n",
    "  summarise(dup_count = sum(count), .groups = \"drop\") %>%  # Again, using .groups = \"drop\"\n",
    "  arrange(desc(dup_count))\n",
    "\n",
    "# Check the output\n",
    "print(item_dup_distribution)\n"
   ]
