   "source": [
    "The scatter plot is a visual way to look at the shopping rules we found. Each dot is one rule, showing how often it happens (support) and how sure we are about it (confidence). The color shows us how strong the connection is between items bought together (lift). Most dots are in the bottom left corner, meaning most rules don't happen very often and aren't very strong, but some rules are better than random chance (lighter dots)."
