   "source": [
    "## CHANGING HYPERPARAMETERS\n",
    "\n",
    "I have run the Apriori algorithm again with a different set of hyperparameters to generate a new set of association rules, named basket_rules2. Here's a breakdown of the changes and the resulting output:\n",
    "\n",
    "minlen=3: I have set the minimum length of the rules to be 3, which means I am now only interested in rules where at least 3 items are involved (e.g., \"if someone buys item A and item B, they are likely to buy item C\").\n",
    "\n",
    "conf=0.1: The minimum confidence has been increased to 0.1, or 10%, indicating that I am looking for rules that are at least 10% reliable.\n",
    "\n",
    "sup=0.001: The minimum support remains the same at 0.001, or 0.1%, meaning I am still interested in itemsets that appear in at least 0.1% of all transactions."
   ]
  },
