    "### Inspection of the association rules\n",
    "**The inspect() function output shows detailed information for the first four association rules from the basket_rules2 object:**\n",
    "\n",
    "Rule 1: If sausage and yogurt are bought, then whole milk is also likely to be bought. This rule has a support of 0.147%, a confidence of 25.58%, a lift of 1.62, and occurred 22 times in the dataset.\n",
    "\n",
    "Rule 2: If sausage and whole milk are bought, then yogurt is also likely to be bought. This rule also has a support of 0.147%, a confidence of 16.42%, a lift of 1.91, and occurred 22 times.\n",
    "\n",
    "Rule 3: If whole milk and yogurt are bought, then sausage is also likely to be bought. This has the same support as the first two rules, a confidence of 13.17%, a lift of 2.18, and also occurred 22 times.\n",
    "\n",
    "Rule 4: If sausage and soda are bought, then whole milk is also likely to be bought. This rule has a support of 0.107%, a confidence of 17.98%, and a lift of 1.14, and occurred 16 times."
   ]
